features.script:
let collide = true
let gifts = ['giftone', 'gifttwo', 'giftthree','giftfour','giftfive','giftsix','giftseven','gifteight','giftnine','giftten','gifteleven','gifttwelve','giftthirteen','giftfourteen','giftfifteen','giftsixteen','giftseventeen','gifteighteen','giftnineteen','gifttwenty']

function random() {
  let index = Math.floor(Math.random() * 20)
  let id = gifts[index];
  let gift = parcel.getFeatureById(id)
  return gift
}

function showRandom() {
  let randomModal = random()
  randomModal.set({ scale: [0.4, 1, 0] })
  randomModal.set({ position: [3.6, 12.5, -1]})
}

function hideAll() {
  let gift = null
  gifts.forEach(g => {
    gift = parcel.getFeatureById(g)
    gift.set({ scale: [0, 0, 0] })
    gift.set({ position: [3.6, 10.5, -1] })
  })
}

feature.on('click', e => {

  if (collide) {
    showRandom()
  } else {
    hideAll()
  }
  collide = !collide
})
